import Map from './Map'
import { Form } from 'react-bootstrap'

export default class Main extends Component {
    constructor(props) {
        super(props)

        this.state = {
            hasBeenSearched: false
        }
    }

    render() {

        const show = (this.state.hasBeenSearched) ? <Map /> : <div> nothing has been searched  </div>

        return (
            <div>
                {show}
                <InputGroup className="mb-3">
    <InputGroup.Prepend>
      <InputGroup.Text id="basic-addon1">@</InputGroup.Text>
    </InputGroup.Prepend>
    <FormControl
      placeholder="Username"
      aria-label="Username"
      aria-describedby="basic-addon1"
    />
  </InputGroup>
            </div>
        )
    }
}
